import React from "react"
import Main from "../interface/main/Main"
import estyle from "./Experience.module.scss"


let mainprops = 
{
    dot1duration: .5,
    dot2duration: .5,
    dot1delay: 1.3,
    dot2delay: 3,
    lineduration: 2,
    linedelay: 1.3,
    color:'teal'
}

const Experience = () => {
    return (
        <div>
            <div className={`${estyle.txt1} ${estyle.space}`}>main bg</div>
            <div className={estyle.somespace}>
                <Main props={mainprops}/>
            </div>
        </div>
    );
};

export default Experience;
